Bombproof Bottoming: Suspension from Sub's Side - with Tifereth and Cannon

Sep 11, 2014 - Performers: Cannon  and  Tifereth


Med, Hi and HD MP4 + Pics.


So you want to fly? Awesome! Tifereth teaches the essentials of being a dynamic suspension rope bottom. With Cannon as her demo rigger, Tifereth discusses strength training and preparing you body for suspension, safety issues, and choosing your rigger wisely. This tutorial offers fundamental safety training for anyone bottoming in a dynamic rope suspension. 

First, you'll learn the core concepts of conditioning, stretching, strength-building, and then hits the ropes to show you how to perform active and passive movements in rope, and ways to explore the different ways to BE dynamic in rope. Discover new ways to think about how bottoms' bodies relate to both the rope and their rigger. 

This all-level tutorial is taught from the bottom's perspective, but Tops are strongly encouraged to watch as well. 

This tutorial's photos include a set of images with step-by-step captions!

